import react from "react";
import styled from "styled-components"
import Button from '@material-ui/core/Button';
import SiteProjeto from '../imagens/site-gif.gif'
import Labefy from '../imagens/labefy.gif'



const ImgProject = styled.img`
  height: 400px;
  width: 500px;
  object-fit: cover;
  @media (max-width: 650px) {
    width: 100%;
    height: 200px;
  }
`


class Projetos extends react.Component{
    render(){
        return(
            <div>
            <p>Nome do projeto: {this.props.nomeProjeto}</p>
            <p>Descricao do projeto: {this.props.descricaoProjeto}</p>
            <p>Feito em: {this.props.requisitosProjeto}</p>
            <ImgProject src={SiteProjeto} alt={'icone'}/>
        </div>
        )
    }

}

export default Projetos
